  return (
    <div className="header">
      <div className="search">
        <input type="text" placeholder="Search" />
        <button>
          <Search></Search>
        </button>
      </div>
      <div className="header_items">
        <a className="hover2" href="">
          Home
        </a>
        <a href="">Products</a>
        <a href="">Contact</a>
        <a href="">Cart</a>
      </div>
    </div>
  );
}
